/*INSERT TUTORS*/
INSERT INTO Tutor (TutorID, Dob, Education, TypeOfDegree, CardID, HourlyRate, Photo, Headline, Description, Address, IsActive, AccountID) 
VALUES ('T0001', '1998-04-16', 'FPT University', 'College',  077100101, 30, '', 'I am Alice',  
'My goal is to increase your SAT Math score by identifying your strengths and weaknesses and creating a custom plan tailored for you. I have personally scored an 800/800 on the SAT Math, so I know full well the best methods to prepare and take the exam. My teaching program not only goes over hundreds of practice questions that are identical to the real exam, but also includes a studying plan that to ensure you fully master every math subject that these questions test.', 
'Error', 1, 'c93968ff-4a02-4dd0-9e91-ca96bf57b694');
INSERT INTO Tutor (TutorID, Dob, Education, TypeOfDegree, CardID, HourlyRate, Photo, Headline, Description, Address, IsActive, AccountID) 
VALUES ('T0002', '1998-04-16', 'FPT University', 'Associate Degree',  077100101, 45, '', 'I am John',  
'I have taught Algebra 2 to the most vulnerable students, those who often didnt have a strong Algebra 1 back ground. I can help find the cracks in your math foundation and propel you to success in this course and the next!', 
'Error', 0, '33bbad25-0741-4588-b596-6504045778da');
INSERT INTO Tutor (TutorID, Dob, Education, TypeOfDegree, CardID, HourlyRate, Photo, Headline, Description, Address, IsActive, AccountID) 
VALUES ('T0003', '1998-04-16', 'FPT University', 'Associate Degree',  077100101, 100, '', 'I am Red',  
'I have over 10 years of experience helping student raise their SAT Math score by hundreds of points! I cant wait to help you achieve a higher score!', 
'Error', 1, 'c3949d5a-7dfd-403a-8627-ddd82eed2be3');
INSERT INTO Tutor (TutorID, Dob, Education, TypeOfDegree, CardID, HourlyRate, Photo, Headline, Description, Address, IsActive, AccountID) 
VALUES ('T0004', '1998-04-16', 'FPT University', 'Bachelors Degree',  077100101, 150, '', 'I am Ruce',  
'Is Chemistry lowering your GPA? Do you need a better understanding of complex chemical concepts? I am your tutor! Wherever you are in the country!

I know and teach the subject perfectly. My students have scored as high as 99% on their finals. After each class you will know your concepts and will be able to apply them very quickly to Quizzes, Tests and Finals.', 
'Error', 1, '2e76159b-8937-46ff-b438-b407dc4b3041');
INSERT INTO Tutor (TutorID, Dob, Education, TypeOfDegree, CardID, HourlyRate, Photo, Headline, Description, Address, IsActive, AccountID) 
VALUES ('T0005', '1998-04-16', 'FPT University', 'Masters Degree',  077100101, 60, '', 'I am Lisa',  
'I have a Degree in Physiology and Chemistry with over seven years of teaching experience. Teaching Certificate in Chemistry for grades 6-12. Over five years of AP Chemistry teaching experience with high pass rates and successful tutoring experiences.', 
'Error', 1, '61fe1135-6e13-4e01-8521-fa817f45a9b5');
INSERT INTO Tutor (TutorID, Dob, Education, TypeOfDegree, CardID, HourlyRate, Photo, Headline, Description, Address, IsActive, AccountID) 
VALUES ('T0006', '1998-04-16', 'FPT University', 'College',  077100101, 45, '', 'I am Ella',  
'Ive tutored all through college and grad school, mostly in chemistry but also in biology, math and Spanish. I love talking to students from different backgrounds and sharing what makes my subjects fun in a way that makes them more approachable. I am really passionate about science education and communication- I believe we make things a lot harder than they need to be, and I love being a part of detangling a subject for the student.', 
'Error', 1, 'a2c8652c-c166-4d2c-a8b4-37898386b6d0');
INSERT INTO Tutor (TutorID, Dob, Education, TypeOfDegree, CardID, HourlyRate, Photo, Headline, Description, Address, IsActive, AccountID) 
VALUES ('T0007', '1998-04-16', 'FPT University', 'Bachelors Degree',  077100101, 67, '', 'I am Zheng',  
'I am a current high school chemistry teacher and have been teaching for the past ten years. A little about my background: I graduated from the University of Illinois at Urbana-Champaign with a chemistry degree. The following year, I received my masters degree in education from the University of Illinois at Chicago. During this time I also received my teaching license and have been teaching high school chemistry ever since. ', 
'Error', 0, '7b3c3b5a-974a-4241-9f7b-13e9834a498b');
INSERT INTO Tutor (TutorID, Dob, Education, TypeOfDegree, CardID, HourlyRate, Photo, Headline, Description, Address, IsActive, AccountID) 
VALUES ('T0008', '1998-04-16', 'FPT University', 'Bachelors Degree',  077100101, 75, '', 'I am Xin',  
'The thing I love most about teaching chemistry are those "Aha!" moments and seeing my students sense of accomplishment shine through after learning a difficult concept. My approach in the classroom mirrors my tutoring methods in that I believe in a problem-based approach. Practice problems are the key to success in chemistry and therefore I always have a whiteboard nearby.', 
'Error', 0, '92453ee8-eb79-413e-90dc-3fb08a9a6b16');
INSERT INTO Tutor (TutorID, Dob, Education, TypeOfDegree, CardID, HourlyRate, Photo, Headline, Description, Address, IsActive, AccountID) 
VALUES ('T0009', '1998-04-16', 'FPT University', 'Doctoral Degree',  077100101, 80, '', 'I am Lieu',  
'Chemistry is a notoriously tough subject but practice truly can make these concepts easy. Feel free to contact me if there is anything else you would like to know or to schedule a lesson. Looking forward to working with you.', 
'Error', 1, '8eb4c14b-8631-42dc-a3c3-8c3effe9a40f');
INSERT INTO Tutor (TutorID, Dob, Education, TypeOfDegree, CardID, HourlyRate, Photo, Headline, Description, Address, IsActive, AccountID) 
VALUES ('T0010', '1998-04-16', 'FPT University', 'Associate Degree',  077100101, 90, '', 'I am Thanh',  
'I CAN HELP YOU OR YOUR CHILD GET A 4 or 5 on the AP exams I tutor. I have worked with many students and those that use me regularly do very well on their exams!!!! This is my 8th year on Wyzant as a tutor and I have been very successful each year. WORK WITH ME ONLINE OR IN PERSON. I can tutor both ways and my online sessions are just like my in person sessions!!!', 
'Error', 1, '41ac2b34-e9c6-472f-8dbd-3b52907c5b85');


